import React from 'react'

function Footer() {
    return (
        <div>

            {/* <!-- Footer --> */}
            <footer class="w3-center w3-black w3-padding-16" style={{paddingtop:10}}>
             <p>Powered by <a href="https://www.w3schools.com/w3css/default.asp" title="W3.CSS" class="w3-hover-text-green">w3.css</a></p>
            </footer>

        </div>
    )
}

export default Footer
